import './App.css';
import Button1 from './components/Button1';
import Button2 from './components/Button2';
import styledComponent from 'styled-components';

function App() {
  return (
    <>
      <Button1 />
      <Button2 />
      <Container>
        <Button>Normal Button</Button>
        <Button primary>Primary Button</Button>
      </Container>
    </>
  );
}

export default App;
